import axios from 'axios';
import config from '../config/environment';

// Create axios instance with base URL
const apiClient = axios.create({
  baseURL: config.backendUrl,
  headers: {
    'Content-Type': 'application/json',
  },
  withCredentials: false, // Set to true if backend uses session cookies
});

// Add request interceptor to include JWT token and handle CORS
apiClient.interceptors.request.use(
  (request) => {
    const token = localStorage.getItem('authToken');
    if (token) {
      request.headers.Authorization = `Bearer ${token}`;
    }
    // Add CORS headers hint
    request.headers['Access-Control-Allow-Credentials'] = 'true';
    console.log(`[API] ${request.method?.toUpperCase()} ${request.url}`, request.data);
    return request;
  },
  (error) => Promise.reject(error)
);

// Add response interceptor to handle errors
apiClient.interceptors.response.use(
  (response) => {
    console.log(`[API Response] ${response.status}`, response.data);
    return response;
  },
  (error) => {
    console.error(`[API Error] ${error.message}`, error.response?.status, error.response?.data);
    if (error.response?.status === 401) {
      // Handle unauthorized - clear token and redirect to login
      localStorage.removeItem('authToken');
      window.location.href = '/login';
    }
    if (error.response?.status === 403) {
      // Handle forbidden - might need authentication
      console.error('Access Forbidden (403) - Backend may require authentication');
    }
    return Promise.reject(error);
  }
);

// Temple Timings API
export const templeTimingsAPI = {
  getAll: () => apiClient.get('/timings'),
  getById: (id) => apiClient.get(`/timings/${id}`),
  getByDay: (day) => apiClient.get(`/timings/day/${day}`),
  create: (data) => apiClient.post('/timings', data),
  update: (id, data) => apiClient.put(`/timings/${id}`, data),
  delete: (id) => apiClient.delete(`/timings/${id}`),
};

// Events API
export const eventsAPI = {
  getAll: () => apiClient.get('/events'),
  getById: (id) => apiClient.get(`/events/${id}`),
  getUpcoming: () => apiClient.get('/events'),
  create: (data) => apiClient.post('/events', data),
  delete: (id) => apiClient.delete(`/events/${id}`),
};

// Service Items API
export const servicesAPI = {
  getAll: () => apiClient.get('/services'),
  getById: (id) => apiClient.get(`/services/${id}`),
  create: (data) => apiClient.post('/services', data),
  update: (id, data) => apiClient.put(`/services/${id}`, data),
  delete: (id) => apiClient.delete(`/services/${id}`),
};

// Priests API
export const priestsAPI = {
  getAll: () => apiClient.get('/priests'),
  getById: (id) => apiClient.get(`/priests/${id}`),
  create: (data) => apiClient.post('/priests', data),
  update: (id, data) => apiClient.put(`/priests/${id}`, data),
  delete: (id) => apiClient.delete(`/priests/${id}`),
};
export const contactAPI = {
  submit: (data) => apiClient.post('/contact', data),
};

// Donors API
export const donorsAPI = {
  getAll: () => apiClient.get('/donors'),
  getById: (id) => apiClient.get(`/donors/${id}`),
  create: (data) => apiClient.post('/donors', data),
  update: (id, data) => apiClient.put(`/donors/${id}`, data),
  delete: (id) => apiClient.delete(`/donors/${id}`),
};

// Authentication API
export const authAPI = {
  login: (credentials) => apiClient.post('/auth/login', credentials),
  logout: () => {
    localStorage.removeItem('authToken');
  },
};

// Sponsorship API
export const sponsorshipAPI = {
  getAll: () => apiClient.get('/sponsorships'),
  getById: (id) => apiClient.get(`/sponsorships/${id}`),
  create: (data) => apiClient.post('/sponsorships', data),
  update: (id, data) => apiClient.put(`/sponsorships/${id}`, data),
  delete: (id) => apiClient.delete(`/sponsorships/${id}`),
};

// Bhojanashala (Community Kitchen) API
export const bhojanaShalaAPI = {
  getAll: () => apiClient.get('/bhojanashala'),
  getById: (id) => apiClient.get(`/bhojanashala/${id}`),
  create: (data) => apiClient.post('/bhojanashala', data),
  update: (id, data) => apiClient.put(`/bhojanashala/${id}`, data),
  delete: (id) => apiClient.delete(`/bhojanashala/${id}`),
};

// Goshala (Cow Sanctuary) API
export const goshakaAPI = {
  getAll: () => apiClient.get('/goshala'),
  getById: (id) => apiClient.get(`/goshala/${id}`),
  create: (data) => apiClient.post('/goshala', data),
  update: (id, data) => apiClient.put(`/goshala/${id}`, data),
  delete: (id) => apiClient.delete(`/goshala/${id}`),
